import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Container} from 'react-bootstrap';

function Home() {
  const navigate = useNavigate();
  return (
    <div className="background-image text-center">
      style={{
    backgroundImage: "url('/images/home2.png')",
    backgroundSize: "cover",
    backgroundPosition: "center",
    height: "500px", // Tinggi elemen dibatasi 500px
    width: "100%",  // Lebar elemen mencakup seluruh lebar layar
    color: "white",
    display: "flex", 
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center"
  }}
      <p className="h1">SISTEM IDENTIFIKASI PENYAKIT PADI</p>
      <p className="h6">Solusi Cerdas untuk Petani</p>
    </div>
  );
}

export default Home;
